Puedes ver este capítulo en YouTube en inglés La inferencia de tipos de datos consiste en que si no se le indica el tipo de datos al compilador, pero lo puede determinar por sí mismo, él decide que tipo utilizar. El compilador siempre necesita conocer el tipo de las variables, pero no siempre es necesario decírselo expresamente. En realidad, normalmente no necesitas indicárselo. Por ejemplo, en la sentencia let mi_numero = 8, mi_numero será de tipo i32. Esto se debe a que el compilador elige siempre el tipo i32 para los números enteros si no se le indica uno. Sin embargo, en la siguiente sentencia let mi_numero: u8 = 8, la variable mi_numero es de tipo u8 ya que así se le ha indicado. Así que normalmente el compilador puede deducir el tipo de datos, pero en ocasiones será necesario indicárselo por una de las siguientes dos razones: Estás programando algo muy complejo y el compilador no puede deducir el tipo de datos que es necesario. Quieres usar un tipo de datos diferente (por ejemplo, quieres un i128, no el i32 que se usa por defecto). Para especificar un tipo, se añaden dos puntos después del nombre de la variable seguido del tipo. fn main() { let numerito: u8 = 10;
} Para los números, se puede especificar el tipo después del número, no se necesita un espacio - solo teclearlo justo después del número. fn main() { let numerito = 10u8; // 10u8 = 10 de tipo u8
} También se puede añadir _ para añadir claridad a la lectura. fn main() { let numerito = 10_u8; // Esto es más fácil de leer let numerazo = 100_000_000_i32; // 100 millones es de fácil lectura con _
} El _ no modifica el número. Solo lo hace más fácil de leer. Y no importa el cuantos _ se utilizan. fn main() { let numero = 0________u8; let numero2 = 1___6______2____4______i32; println!("{}, {}", numero, numero2);
} Lo anterior imprime 0, 1624.

