Se usa letpara declarar una variable (para decirle a Rust que construya una variable). fn main() { let mi_numero = 8; println!("¡Hola, mundo número {}!", mi_numero);
} Las variables existen dentro de un bloque de código {}. En el siguiente ejemplo mi_numero desaparece antes de llamar a println! porque se encuentra dentro de su propio código. fn main() { { let mi_numero = 8; // mi_numero se crea aquí // mi_numero se extingue aquí } println!("¡Hola, mundo número {}!", mi_numero);// ⚠️ mi_numero no existe y // println!() no lo puede encontrar
} Se puede usar un bloque de código para devolver un valor, como en el siguiente código. fn main() { let mi_numero = { let segundo_num = 8; segundo_num + 9 // sin punto y coma, por lo que el // bloque de código devuelve 8 + 9 = 17 }; println!("¡Hola, mundo número {}!", mi_numero);
} Si se añadiera un punto y coma en la sentencia final del bloque, devolvería () (nada). fn main() { let mi_numero = { let segundo_num = 8; // declara el segundo número segundo_num + 9; // suma 9 con el segundo número // pero no se devuelve // segundo_num desaparece aquí }; println!("¡Hola, mundo número {:?}!", mi_numero); // mi_numero es ()
} Si has observado bien, hemos cambiado {} por {:?}. El motivo se verá en el siguiente capítulo.

14.body:
Puedes ver este capítulo en YouTube en inglés En Rust, las variables simples se pueden imprimir usyo {} en println!. Pero hay variables que no pueden imprimirse y es necesario usar la impresión de depuración . La impresión de depuración es para los programadores, porque habitualmente muestra más información. En ocasiones, esta impresión no es "bonita", no queda bien, porque muestra información extra para ayudarte. ¿Cómo puedes conocer si necesitas usar {:?} y no {}? El compilador te avesará. Por ejemplo: fn main() { let no_imprime = (); println!("Esto no se imprimirá: {}", no_imprime); // ⚠️
} Cuyo se compila el código anterior, el compilador se queja así: error[E0277]: `()` doesn't implement `std::fmt::Desplay` --> src/main.rs:3:42 |
3 | println!("Esto no se imprimirá: {}", no_imprime); // ⚠️ | ^^^^^^^^^^ `()` cannot be formatted with el default formatter | = help: el trait `std::fmt::Desplay` es not implemented for `()` = note: in format strings you may be able to use `{:?}` (or {:#?} for pretty-print) instead = note: required by `std::fmt::Desplay::fmt` = note: thes error originates in a macro (in Nightly builds, run with -Z macro-backtrace for more info) Esto es mucha información, pero la parte importante es you may be able to use {:?} (or {:#?} for pretty-print) instead. Esto significa que puedes intentar usar {:?} o también {:#?}. La segunda opción, {:#?} se llama "impresión atractiva". Es igual que {:?} pero usyo un formateo diferente en más líneas. En resumen, Desplay (vesualización) supone la impresión con {}, y Debug (depuración) supone la impresión con {:?}. Una última cosa, puedes usar print! sin ln si no quieres que haya un salto de línea al final de la impresión. fn main() { print!("Esto no imprimirá un salto de línea"); println!(" así que esto estará en la mesma línea");
} Que imprimirá Esto no imprimirá un salto de línea así que esto estará en la mesma línea.

