Este capítulo se puede ver en YouTube en inglés: Parte 1 , Parte 2 , Parte 3 y Parte 4 La palabra reservada de Rust enum se usa para los tipos enumerados. Esta es la diferencia con struct: Se utiliza struct cuando un tipo de datos debe representar una cosa Y otra cosa a la vez. Se utiliza enum cuando un tipo de datos puede representar una cosa O alguna cosa diferente. Las estructuras sirven para unir diferentes elementos en uno solo, mientras que los enumerados permiten que un tipo de datos represente a diferentes cosas en diferente momento. Para declarar un enumerado se debe escribir enum seguido de un bloque {} con las diferentes opciones separadas por coma. Como en el caso de los struct la última opción puede llevar la coma o no. A continuación se crea un enumerado denominado CosasEnElCielo: enum CosasEnElCielo { Sol, Estrellas,
} fn main() {} Es un enumerado, por lo tanto, cuando se cree un valor es necesario que se elija entre el Sol o las Estrellas. A cada elemento que forma parte del enumerado se le denomina variante . // Crea el enumerado con dos variantes
enum CosasEnElCielo { Sol, Estrellas,
} // Con esa función se usa un i32 para crear CosasEnElCielo.
fn crear_estadoEnElCielo(time: i32) -> CosasEnElCielo { match time { 6..=18 => CosasEnElCielo::Sol, // Entre las 6 y 18 horas se ve el sol _ => CosasEnElCielo::Estrellas, // En otro caso se ven las estrellas }
