} fn main() {} Se observa que Result tiene un valor dentro de Ok y también el caso de Err. Se trata de poder gestionar la información específica que describe el error que haya sucedido cuando este se produzca. Al tener dos parámetros de tipo, Result<T, E>, se debe indicar qué se devuelve cuando el resultado es correcto, Ok(T), y qué se devuelve cuando el resultado es erróneo, Err(E). Puede ser cualquier cosa que se decida, incluso: fn check_error() -> Result<(), ()> { Ok(())
