Un HashMap es una colección compuesta por claves y valores . Se puede usar la clave para recuperar el valor que se almacenó con ella. Se puede crear un HashMap con HashMap::new() y se pueden insertar nuevos elementos mediante .insert(clave, valor). Los HashMap no están ordenados, por lo que si se imprimen todas las claves almacenadas, probablemente saldrán en cualquier orden. Se puede ver con un ejemplo: use std::collections::HashMap; // Así, bastará con escribir
// HashMap cada vez, en lugar de std::collections::HashMap struct Ciudad { nombre: String, poblacion: HashMap<u32, u32>, // Almacenará el año //y la población de cada año
} fn main() { let mut tallinn = Ciudad { nombre: "Tallinn".to_string(), poblacion: HashMap::new(), // En este momento el HashMap está vacío }; tallinn.poblacion.insert(1372, 3_250); // inserta tres fechas tallinn.poblacion.insert(1851, 24_000); tallinn.poblacion.insert(2020, 437_619); for (año, poblacion) in tallinn.poblacion { // El tipo del Hashmap es HashMap<u32, u32>. Obtiene en cada iteración un par clave/valor println!("En el año {} la ciudad de {} tenía una población de {}.", año, tallinn.nombre, poblacion); }
} Que puede imprimir: En el año 1372 la ciudad de Tallinn tenía una población de 3250.
En el año 2020 la ciudad de Tallinn tenía una población de 437619.
En el año 1851 la ciudad de Tallinn tenía una población de 24000. Pero también podría imprimir: En el año 1851 la ciudad de Tallinn tenía una población de 24000.
En el año 2020 la ciudad de Tallinn tenía una población de 437619.
En el año 1372 la ciudad de Tallinn tenía una población de 3250. Se puede observar que no está en orden. Si se necesita una colección para almacenar parejas de clave y valor, se puede utilizar BTreeMap, que funciona igual que HashMap, pero mantiene el orden por clave. use std::collections::BTreeMap; // Así, bastará con cambiar HashMap a BTreeMap struct Ciudad { nombre: String, poblacion: BTreeMap<u32, u32>, } fn main() { let mut tallinn = Ciudad { nombre: "Tallinn".to_string(), poblacion: BTreeMap::new(), }; tallinn.poblacion.insert(1372, 3_250); tallinn.poblacion.insert(1851, 24_000); tallinn.poblacion.insert(2020, 437_619); for (año, poblacion) in tallinn.poblacion { println!("En el año {} la ciudad de {} tenía una población de {}.", año, tallinn.nombre, poblacion); }
} Ahora, siempre se imprime: En el año 1372 la ciudad de Tallinn tenía una población de 3250.
En el año 1851 la ciudad de Tallinn tenía una población de 24000.
En el año 2020 la ciudad de Tallinn tenía una población de 437619. Volviendo a los HashMap. Se puede recuperar un valor determinado simplemente escribiendo la clave entre [] corchetes. En el siguiente ejemplo se recuperará el valor de la clave Bielefeld que está en Alemania. La aplicación fallará si no existe la clave. Si se escribe println!(("{:?}", ciudad_hashmap["Bielefeldd"]);, fallará, porque Bielefelddno existe. Si no se está seguro de que exista una clave determinada, se puede usar get() que devuelve un tipo Option. Si existe sera Some(value) y si no, contendrá None, pero no fallará la aplicación. Por eso, la forma adecuada de recuperar un valor de un HashMap es usar get(). use std::collections::HashMap; fn main() { let ciudades_canadieneses = vec!["Calgary", "Vancouver", "Gimli"]; let ciudades_alemanas = vec!["Karlsruhe", "Bad Doberan", "Bielefeld"]; let mut ciudad_hashmap = HashMap::new(); for ciudad in ciudades_canadieneses { ciudad_hashmap.insert(ciudad, "Canadá"); } for ciudad in ciudades_alemanas { ciudad_hashmap.insert(ciudad, "Alemania"); } println!("{:?}", ciudad_hashmap["Bielefeld"]); println!("{:?}", ciudad_hashmap.get("Bielefeld")); println!("{:?}", ciudad_hashmap.get("Bielefeldd"));
} Que imprime: "Alemania"
Some("Alemania")
None Esto sucede porque Bielefeld existe, pero Bielefeldd no. Si un HashMapya contiene una clave y se intenta insertar un nuevo valor, el antiguo se sobreescribe. use std::collections::HashMap; fn main() { let mut book_hashmap = HashMap::new(); book_hashmap.insert(1, "L'Allemagne Moderne"); book_hashmap.insert(1, "Le Petit Prince"); book_hashmap.insert(1, "섀도우 오브 유어 스마일"); book_hashmap.insert(1, "Eye of the World"); println!("{:?}", book_hashmap.get(&1));
} Que imprime Some("Eye of the World"), porque fue el último valor utilizado en al insertar con .insert(). Es fácil comprobar si un valor existe cotejando el enumerado Option que devuelve .get(). use std::collections::HashMap; fn main() { let mut book_hashmap = HashMap::new(); book_hashmap.insert(1, "L'Allemagne Moderne"); if book_hashmap.get(&1).is_none() { // is_none() devuelve un bool: true si es None, false si es Some book_hashmap.insert(1, "Le Petit Prince"); } println!("{:?}", book_hashmap.get(&1));
} Que imprime Some("L\'Allemagne Moderne") porque existía ya una clave 1, por lo que no se llegó a insertar Le Petit Prince. HashMap tiene un método muy interesante denominado .entry() que se puede utilizar. Con el resultado de este método (que devuelve un valor de tipo enumerado Entry) se puede utilizar el método .or_entry() para insertar un valor solo si no existe una clave. La parte interesante es que devuelve una referencia modificable por polo que se puede modificar si se quiere. En el siguiente ejemplo e inserta true cada vez que se inserta un libro en el HashMap. Se quiere llevar el seguimiento de los libros de un biblioteca. use std::collections::HashMap; fn main() { let book_collection = vec!["L'Allemagne Moderne", "Le Petit Prince", "Eye of the World", "Eye of the World"]; // Eye of the World aparece dos veces let mut book_hashmap = HashMap::new(); for book in book_collection { book_hashmap.entry(book).or_insert(true); } for (book, true_or_false) in book_hashmap { println!("¿Tenemos el libro {}? {}", book, true_or_false); }
} Que imprime: ¿Tenemos el libro Eye of the World? true
