¿Tenemos el libro L'Allemagne Moderne? true Pero esto no es exactamente lo que se quiere. Sería mejor contar el número de copias de cada libro para que se pueda conocer que existen dos copias de Eye of the world . En primer lugar, se va a estudiar lo que hace el método .entry() y el método .or_insert(). .entry() devuelve un enum llamado Entry: pub fn entry(&mut self, key: K) -> Entry<K, V> // 🚧 Esta es la página de Entry . Esa es una versión simplificada de su código. K representa el tipo de la clave y V representa el tipo del valor. // 🚧
use std::collections::hash_map::*; enum Entry<K, V> { Occupied(OccupiedEntry<K, V>), Vacant(VacantEntry<K, V>),
} Cuando se llama a .or_insert() se observa el tipo concreto del enumerado y se decide qué hacer: fn or_insert(self, default: V) -> &mut V { // 🚧 match self { Occupied(entry) => entry.into_mut(), Vacant(entry) => entry.insert(default), }
} Lo más interesante es que se devuelve una referencia modificable: &mut V. Esto significa que se puede usar let para asignarla a una variable y cambiar la variable para cambiar el valor del HashMap. Así, para cada libro se insertará un 0 si no hay una entrada. Si hay una, se utilizará +=1 en la referencia para incrementar la cuenta. El código queda así: use std::collections::HashMap; fn main() { let book_collection = vec!["L'Allemagne Moderne", "Le Petit Prince", "Eye of the World", "Eye of the World"]; let mut book_hashmap = HashMap::new(); for book in book_collection { let return_value = book_hashmap.entry(book).or_insert(0); // return_value es una referencia mutable. // Si no contiene nada, se asigna un cero. *return_value +=1; // Ahora return_value vale al menos 1. // Y si ya tenía algún valor, lo incrementa en uno } for (book, numero) in book_hashmap { println!("{}, {}", book, numero); }
} Lo important es let return_value = book_hashmap.entry(book).or_insert(0);. Si no se asignara el valor a una variable, se asignaría el 0 cuando no hubiera valor, pero se perdería la referencia modificable. Al conservarla en la variable return_value, se puede modificar el valor sumándole 1 en este caso. Cuando esto sucede por segunda vez para un mismo valor, no se crea ninguna entrada nueva con un valor 0, sino que simplemente se devuelve el valor para que se pueda incrementar. Así el resultado de este programa es: L'Allemagne Moderne, 1
Le Petit Prince, 1
Eye of the World, 2 También se pueden hacer otras cosas con .or_insert() como insertar un vector y luego insertar en el vector. Por ejemplo, si se supone que se pregunta a hombres y mujeres qué opinan de un político para que les asignen una valoración de 0 a 10, se pueden clasificar juntos los puntos para saber si un político es más popular entre los hombres o entre las mujeres, el código podría ser así: use std::collections::HashMap; fn main() { let data = vec![ // Estos son los datos puros ("hombre", 9), ("mujer", 5), ("hombre", 0), ("mujer", 6), ("mujer", 5), ("hombre", 10), ]; let mut survey_hash = HashMap::new(); for item in data { // Devuelve una tupla de (&str, i32) survey_hash.entry(item.0) .or_insert(Vec::new()) .push(item.1); // Añade el número al vector contenido en el valor correspondiente del HashMap } for (hombre_or_mujer, numeros) in survey_hash { println!("{:?}: {:?}", hombre_or_mujer, numeros); }
} Que imprime: "mujer", [5, 6, 5]
"hombre", [9, 0, 10] La línea de código importante es survey_hash.entry(item.0).or_insert(Vec::new()).push(item.1); que si recibe una "mujer" comprobará si ya existe en el HashMap. Si no existe, insertará Vec::new() y después insertará el número en el vector. Si existe, no insertará ningún vector nuevo, lo recuperará e insertará el número en el vector.

