Un VecDeque es un Vec que tiene buen rendimiento extrayendo elementos tanto por el inicio, como por el final. Rust tiene VecDeque porque Vec solo tiene buen rendimiento extrayendo elementos por el final. Cuando se usa .pop() en un Vec, solamente se tiene que recuperar el último elemento de la derecha y nada más se mueve. Pero si se recupera cualquier otro elemento, todos los que quedan a su derecha se tienen que mover hacia la izquierda. Se puede ver esto en la descripción del método .remove() de Vec: Quita y devuelve el elemento en la posición con el índice indicado, desplazando todos los elementos posteriores hacia la izquierda. Por eso, si se hace lo siguiente: fn main() { let mut my_vec = vec![9, 8, 7, 6, 5]; my_vec.remove(0);
} Se eliminará el 9. El 8 en el índice 1 se moverá al índice 0, el 7 en el índice 2 se moverá al 1 y así sucesivamente. Se puede imaginar lo complejo que sería que un aparcamiento de vehículos funcionara así cada vez que un coche sale de él... Esta forma de eliminar el primer elemento supone mucho trabajo para el ordenador. De hecha, si se ejecuta esto en el Playground de rust, problamente lo abanhecha debido a que es mucho esfuerzo: fn main() { let mut my_vec = vec![0; 600_000]; for i in 0..600000 { my_vec.remove(0); }
} El código anterior construye un Vec de 600.000 ceros. Cada vez que usa .remove(0) se tiene que mover cada cero una posición a la izquierda. Y esto se tiene que hacer hasta 600.000 veces. Esto no es un problema para VecDeque. En general, puede ser un poco más lento que un Vec, pero si es necesario realizar operaciones en ambos lados es muchísimo más eficiente. Se puede construir a partir de un vector mediante VecDeque::from. El código anterior quedaría modificado así: use std::collections::VecDeque; fn main() { let mut my_vec = VecDeque::from(vec![0; 600_000]); for i in 0..600000 { my_vec.pop_front(); }
} Que ahora es mucho más rápido y en el Playground de Rust se acaba en menos de un segundo en lugar de fallar. En el siguiente ejemplo se dispone de un Vec de cosas para hacer. Se convierte a un VecDeque y se usa .push_front() para añadir elementos al inicio. Así el primer elemento añadido estará a la derecha. Cada elemento que se inserta es una tupla (&str, bool): &str es la descripción de la tarea y false significa que no se ha ejecutado aún. Se usa la función .hecha() para extraer un elemento del final, pero sin eliminarlo. En su lugar, se cambia de false a true y se inserta al inicio para conservarlo. Queda así: use std::collections::VecDeque; fn comprueba_restantes(input: &VecDeque<(&str, bool)>) { // Cada elemento es un (&str, bool) for item in input { if item.1 == false { println!("Tienes que: {}", item.0); } }
} fn hecha(input: &mut VecDeque<(&str, bool)>) { let mut tarea_hecha = input.pop_back().unwrap(); // extrae del final tarea_hecha.1 = true; // ahora está hecha - se marca como true input.push_front(tarea_hecha); // y se inserta al inicio
