Existe una forma más corta de gestionar un valor de tipo Result (y Option). más corta que match y que if let. Es el "operador interrogación" y es ?. Después de una función devuelve un resultado, se puede añadir ? para: devolver el valor contenido en Ok, si es el tipo concreto de Result. o elevar el error si es Err. En otras palabras, hace casi todo por ti. Por ejemplo, se puede probar esto con .parse(). En el siguiente ejemplo se presenta la función parse_str que intenta convertir un &str a i32: use std::num::ParseIntError; fn parse_str(input: &str) -> Result<i32, ParseIntError> { let parsed_number = input.parse::<i32>()?; // Aquí está el ? Ok(parsed_number)
} fn main() {} Esta función toma un &str. Si es Ok, devuelve un i32 envuelto en un Ok. Si es un Err, devuelve ParseIntError. Al intentar obtener el número y haberse añadido ? lo que se hace es comprobar si esta llamada a parse ha devuelto Ok y obtener el contenido de este. Si no es correcto, devolverá un error y finalizará en la linea de parse. Pero si es correcto avanza hasta la línea siguiente para devolver Ok(i32). Es necesario envolver el número para que sea compatible con el valor de retorno de la función Result<i32, ParseIntError>, no i32. Ahora, se puede probar a ejecutar la función. Se observa a continuación lo que sucede con un vector de &str. fn parse_str(input: &str) -> Result<i32, std::num::ParseIntError> { let parsed_number = input.parse::<i32>()?; Ok(parsed_number)
} fn main() { let str_vec = vec!["Siete", "8", "9.0", "bien", "6060"]; for item in str_vec { let parsed = parse_str(item); println!("{:?}", parsed); }
} Que imprime: Err(ParseIntError { kind: InvalidDigit })
Ok(8)
Err(ParseIntError { kind: InvalidDigit })
Err(ParseIntError { kind: InvalidDigit })
Ok(6060) ¿Cómo se puede conocer que el error de esta función parse era std::num::ParseIntError? Una forma fácil es "pedírselo" al compilador: fn main() { let failure = "No es un número".parse::<i32>(); failure.rbrbrb(); // ⚠️ Compilador: "¿Qué es rbrbrb()???"
} El compilador se "queja" con: error[E0599]: no method named `rbrbrb` found for enum `std::result::Result<i32, std::num::ParseIntError>` in the current scope --> src\main.rs:3:13 |
3 | failure.rbrbrb(); | ^^^^^^ method not found in `std::result::Result<i32, std::num::ParseIntError>` Así se deduce que la definición de tipo que devuelve parse es std::result::Result<i32, std::num::ParseIntError>. No se necesita escribir std::result::Result porque Result está siempre visible en el alcance (alcance = listo para su uso). Rust hace esto para todos los tipos que se utilizan mucho para que no sea necesario escribir o usar std::result::Result, std::collections::Vec, etc. Aún no se han presentado recursos como los ficheros, por lo que el operador ? no parece aún muy útil. El siguiente ejemplo muestra cómo se puede ilustrar este uso en una sola línea. En lugar de construir un i32 con .parse(), se hace mucho más. Se construye un u16, luego se convierte a String, después se convierte a u32 y de nuevo se pasa a String para, finalmente, convertirlo en un i32. use std::num::ParseIntError; fn parse_str(input: &str) -> Result<i32, ParseIntError> { let parsed_number = input.parse::<u16>()?.to_string().parse::<u32>()?.to_string().parse::<i32>()?; // Se añade ? a cada función para validar la corrección y pasar el valor Ok(parsed_number)
} fn main() { let str_vec = vec!["Siete", "8", "9.0", "bien", "6060"]; for item in str_vec { let parsed = parse_str(item); println!("{:?}", parsed); }
} Esto imprime lo mismo, pero después de haber procesado tres Result en una sola línea. Después, se mostrará un ejemplo parecido con ficheros, puesto que las funciones asociadas siempre devuelven Result ya que pueden ir mal muchas cosas cuando se accede a ellos. Se puede imaginar lo siguiente: se quiere abrir un fichero, escribir y cerrarlo. Lo primero es encontrar el fichero con éxito (eso es un Result); después, escribir en él sin fallos (esto es otro Result). Con ? se puede hacer todo en una sola línea.

