Rust dispone de una macro panic! que se puede utilizar para que "entre en pánico". fn main() { panic!("¡hora de entrar en pánico!");
} Cuando se ejecuta este programa se muestra el siguiente mensaje: thread 'main' panicked at '¡hora de entrar en pánico!', src/main.rs:2:5. Se muestra el programa, la línea de código y columna 2:5 en el que se "entró en pánico". Con esta información, se puede buscar la línea de código y arreglarla. panic! tiene utilidad para asegurar que algo no cambia. Por ejemplo, la siguiente función imprime_tres_cosas siempre imprime los índices [0], [1] y [2] de un vector. Esto está bien siempre que reciba un vector con tres elementos. fn imprime_tres_cosas(vector: Vec<i32>) { println!("{}, {}, {}", vector[0], vector[1], vector[2]);
} fn main() { let my_vec = vec![8, 9, 10]; imprime_tres_cosas(my_vec);
} Esto imprime 8, 9 y 10 correctamente. Si posteriormente se escribe más código y se olvida que my_vec tiene que ser siempre de tres elementos, se puede acabar un vector de seis elementos como en el caso siguiente: fn imprime_tres_cosas(vector: Vec<i32>) { println!("{}, {}, {}", vector[0], vector[1], vector[2]);
} fn main() { let my_vec = vec![8, 9, 10, 10, 55, 99]; // Ahora tiene seis elementos imprime_tres_cosas(my_vec);
