} fn main() { let my_vec = vec![8, 9, 10]; imprime_tres_cosas(my_vec);
} Ahora, si el vector tuviera seis elementos, el programa fallaría (N.T. a las condiciones que se deben cumplir siempre en una función -en sus parámetros o valores de retorno o durante su ejecución- se le denomina "invariante". Rust proporciona macros específicas para ello assert! y assert_debug!): // ⚠️
