} El código anterior funciona sin problemas ya que en este caso todas las macros comprueban con éxito los valores que reciben como parámetro. También es posible añadir un mensaje a cada macro: fn main() { let my_name = "Loki Laufeyson"; assert!( my_name == "Loki Laufeyson", "{} should be Loki Laufeyson", my_name ); assert_eq!( my_name, "Loki Laufeyson", "{} and Loki Laufeyson should be equal", my_name ); assert_ne!( my_name, "Mithridates", "You entered {}. Input must not equal Mithridates", my_name );
} Estos mensajes se mostrarán solamente si el programa entra en pánico (no se cumple la condición que establece la macro). Por eso, si se ejecuta lo siguiente: fn main() { let my_name = "Mithridates"; assert_ne!( my_name, "Mithridates", "You enter {}. Input must not equal Mithridates", my_name );
