} El mensaje es "thread 'main' panicked at 'called `Option::unwrap()` on a `None` value', src/main.rs:2:42. No se puede saber en qué unwrap sucedió hasta revisar la línea. Sería mejor valorar la longitud y no unwrap. Pero con .expect() al menos será un poco mejor: fn intenta_dos_unwrap(input: Vec<Option<i32>>) { println!("Index 0 is: {}", input[0].expect("¡El primer unwrap contenía un None!")); println!("Index 1 is: {}", input[1].expect("¡El segundo unwrap contenía un None!"));
} fn main() { let vector = vec![None, Some(1000)]; intenta_dos_unwrap(vector);
} Ahora el resultado es algo mejor: thread 'main' panicked at '¡El primer unwrap contenía un None!', src/main.rs:2:41. Y se dispone también de la línea en la que ha sucedido para encontrarlo. También se puede utilizar unwrap_or si siempre existe un valor a usar por defecto cuando se devuelve None. Esta función no entra en pánico. Esto es: Bueno, porque el programa no entra en pánico, pero... no tan bueno si se quiere detectar un problema en el código. En todo caso, lo habitual es que no se quiera que el programa entre en pánico, por lo que unwrap_or es muy útil. fn main() { let my_vec = vec![8, 9, 10]; let cuatro = my_vec.get(3).unwrap_or(&0); // Si .get no funciona, // se toma por defecto el &0. // .get devuelve una referencia, por eso se necesita &0 println!("{}", cuatro);
} Esto imprime 0 porque .unwrap_or(&0) devuelve 0 cuando el Option es un None.

