From es un rasgo muy útil que ya se ha usado. Con From se puede crear una String a partir de una &str, pero se puede usar para convertir cualquier tipo en otro. Por ejemplo, Vec utiliza From para lo siguiente: From<&'_ [T]>
From<&'_ mut [T]>
From<&'_ str>
From<&'a Vec<T>>
From<[T; N]>
From<BinaryHeap<T>>
From<Box<[T]>>
From<CString>
From<Cow<'a, [T]>>
From<String>
From<Vec<NonZeroU8>>
From<Vec<T>>
From<VecDeque<T>> Implementa un montón de Vec::from() que no se han usado aún en este manual. Se pueden usar algunos para ver qué pasa. use std::fmt::Display; // se usará Display para crear una función genérica y mostrar el resultado fn print_vec<T: Display>(input: &Vec<T>) { // Toma cualquier Vec<T> cuyo tipo T que tenga Display for item in input { print!("{} ", item); } println!();
} fn main() { let array_vec = Vec::from([8, 9, 10]); // "from" un array print_vec(&array_vec); let str_vec = Vec::from("¿Qué clase de vector seré?"); // Array "from" un &str print_vec(&str_vec); let string_vec = Vec::from("Un String ¿Qué clase de vector será?".to_string()); // También "from" un String print_vec(&string_vec);
} Se imprime lo siguiente: 8 9 10
87 104 97 116 32 107 105 110 100 32 111 102 32 118 101 99 32 119 105 108 108 32 73 32 98 101 63
87 104 97 116 32 107 105 110 100 32 111 102 32 118 101 99 32 119 105 108 108 32 97 32 83 116 114 105 110 103 32 98 101 63 Si se observa el tipo, los segundo y tercer vector son de tipo Vec<u8>, lo que significa que contiene los bytes de &str y String. Se ve así que From es muy flexible y se usa mucho. El siguiente ejemplo implemente From en tipos desarrollados en el código. Se construyen dos structs y luego implementan From para una de ellas. Una será una Ciudad y la otra un Pais. Se quiere que sea posible hacer esto: let country_nombre = Pais::from(vector_de_ciudades). Queda así el código: #[derive(Debug)] // Para poder imprimir la Ciudad
struct Ciudad { nombre: String, poblacion: u32,
} impl Ciudad { fn new(nombre: &str, poblacion: u32) -> Self { // función new Self { nombre: nombre.to_string(), poblacion, } }
}
#[derive(Debug)] // Pais necesita imprimirse
struct Pais { ciudades: Vec<Ciudad>, // Las ciudades van aquí
} impl From<Vec<Ciudad>> for Pais { // Note: no se crea From<Ciudad>, se crea // From<Vec<Ciudad>>. Es decir, sobre un tipo, Vec, que no se ha creado en el código fn from(ciudades: Vec<Ciudad>) -> Self { Self { ciudades } }
} impl Pais { fn imprimir_ciudades(&self) { // función para imprimir las ciudades del Pais for ciudad in &self.ciudades { // & porque Vec<Ciudad> no es Copy println!("{:?} tiene una población de {:?}.", ciudad.nombre, ciudad.poblacion); } }
} fn main() { let helsinki = Ciudad::new("Helsinki", 631_695); let turku = Ciudad::new("Turku", 186_756); let finland_ciudades = vec![helsinki, turku]; // Esto es el Vec<Ciudad> let finland = Pais::from(finland_ciudades); // En este punto se usa From finland.imprimir_ciudades();
} Que imprime: "Helsinki" tiene una población de 631695.
"Turku" tiene una población de 186756. Se observa que es fácil implementar From para tipos que no se han creado por el desarrollador, por ejemplo, Vec, i32 o cualquier otro. A continuación, se muestra otro ejemplo en el que se crea un vector que contiene dos vectores. El primer vector contiene números pares y el segundo, impares. Con From se puede tomar un vector de i32 y convertirlo en Vec<Vec<i32>>: un vector que contiene vectores de i32. use std::convert::From; struct ParImparVec(Vec<Vec<i32>>); impl From<Vec<i32>> for ParImparVec { fn from(input: Vec<i32>) -> Self { let mut par_impar_vec: Vec<Vec<i32>> = vec![vec![], vec![]]; // Un vec con dos vecs vacíos dentro // se rellena para después retornarlo for item in input { if item % 2 == 0 { par_impar_vec[0].push(item); } else { par_impar_vec[1].push(item); } } Self(par_impar_vec) // una vez relleno se devuelve como Self (Self = ParImparVec) }
} fn main() { let varios_numero = vec![8, 7, -1, 3, 222, 9787, -47, 77, 0, 55, 7, 8]; let new_vec = ParImparVec::from(varios_numero); println!("Números pares: {:?}\nNúmeros impares: {:?}", new_vec.0[0], new_vec.0[1]);
} Lo anterior imprime: Números pares: [8, 222, 0, 8]
Números impares: [7, -1, 3, 9787, -47, 77, 55, 7] Un tipo como ParImparVec es mejor definirlo como genérico T para poder usarlo en muchos tipos de números. Se deja esta idea como práctica.

