En ocasiones se necesita que una función pueda recibir tanto String como &str en el mismo parámetro. Esto se puede conseguir con genéricos y con el rasgo AsRef. AsRef se utiliza para pasar una referencia de un tipo a otro tipo. Si se observa la documentación de String, se ve que implementa AsRef para muchos tipos: https://doc.rust-lang.org/std/string/struct.String.html Estas son algunas de las declaraciones de función: AsRef<str>: // 🚧
impl AsRef<str> for String fn as_ref(&self) -> &str AsRef<[u8]>: // 🚧
impl AsRef<[u8]> for String fn as_ref(&self) -> &[u8] AsRef<OsStr>: // 🚧
impl AsRef<OsStr> for String fn as_ref(&self) -> &OsStr Se observa que implementa la función as_ref que recibe como parámetro &self y devuelve una referencia a otro tipo. Esto permite que si se dispone de un tipo genérico T, se pueda indicar que ese tipo necesita AsRef<str>. Así, será posible que se pase como un &str o un String. El código siguiente implementa la función genérica, pero da error: fn imprimelo<T>(input: T) { println!("{}", input) // ⚠️
} fn main() { imprimelo("Por favor, imprímeme");
} Rust dice error[E0277]: T doesn't implement std::fmt::Display. Se necesita que lo implemente: use std::fmt::Display; fn imprimelo<T: Display>(input: T) { println!("{}", input)
} fn main() { imprimelo("Por favor, imprímeme");
} Ahora funciona e imprime Por favor, imprímeme. Eso es mejor, pero T puede ser muchas cosas aún. Puede ser i8, f32 o cualquier cosa que tenga Display. Si se añade ahora AsRef<str>, T necesita ambos rasgos. use std::fmt::Display; fn imprimelo<T: AsRef<str> + Display>(input: T) { println!("{}", input)
} fn main() { imprimelo("Por favor, imprímeme"); imprimelo("También, por favor, imprímeme".to_string()); // imprimelo(7); <- Esto no compilará
} Ahora no dejará pasar tipos como i8. No se puede olvidar que se puede utilizar where ara escribir de forma más compacta la declaración de la función cuando esta se hace muy larga. Si se añadiera Debug la línea quedaría muy larga, fn imprimelo<T: AsRef<str> + Display + Debug>(input: T), así que se puede escribir de la siguiente forma. use std::fmt::{Debug, Display}; // añade Debug fn imprimelo<T>(input: T) // Ahora la línea es más fácil de leer
where T: AsRef<str> + Debug + Display, // y también se leen bien los rasgos del tipo
{ println!("{}", input)
} fn main() { imprimelo("Por favor, imprímeme"); imprimelo("También, por favor, imprímeme".to_string());
