Un iterador es una construcción del lenguaje Rust que recupera los elementos contenidos en una colección uno a uno. En realidad, ya se han utilizado de forma frecuente los iteradores en los capítulos anteriores: el bucle for entrega un iterador. Para obtener un iterador para otros usos, es necesario indicar el tipo que se requiere: .iter() para iterar a través de referencias a los elementos. .iter_mut() para iterar mediante referencias modificables (mutables). .into_iter() para obtener un iterador sobre valores, no referencias. Un bucle for es solo un iterador que es propietario de sus valores. Es por eso que se puede hacer modificable y se pueden cambiar los valores cuando se utiliza. Los iteradores se pueden usar como sigue: fn main() { let vector1 = vec![1, 2, 3]; // Se usará .iter() y .into_iter() sobre este vector let vector1_a = vector1.iter().map(|x| x + 1).collect::<Vec<i32>>(); let vector1_b = vector1.into_iter().map(|x| x * 10).collect::<Vec<i32>>(); let mut vector2 = vec![10, 20, 30]; // Se usará .iter_mut() sobre este otro vector vector2.iter_mut().for_each(|x| *x +=100); println!("{:?}", vector1_a); println!("{:?}", vector2); println!("{:?}", vector1_b);
} Que imprime: [2, 3, 4]
[110, 120, 130]
[10, 20, 30] En los primeros dos casos se ha utilizado el método map() que permite ejecutar algún código sobre cada elemento antes de pasarlo a la siguiente función. En el último caso se hay utilizado el método for_each(). Este método ejecuta el código que contiene sobre cada elemento que recibe. El uso de .iter_mut() junto con for_each() equivalen a un bucle for. Dentro de cada método se puede dar un nombre a cada elemento (en el ejemplo, se ha utilizado x) y se ha modificado. A este tipo de funciones se las denomina closures y se ven en la siguiente sección. Si se revisa el código anterior paso a paso: En primer lugar se usa .iter() en el vector1 para obtener unas referencias a los elementos. Después se ha usado map() para sumar 1 y devolver nuevos valores en un nuevo vector. El vector1 aún está disponible ya que solo se han usado referencias a sus elementos: se ha tomado ningún valor. Al final, resulta necesario utilizar collect() para crear un nuevo vector con los nuevos elementos que map() ha ido generando. En segundo lugar, se usa .into_iter() para obtener un iterador sobre los valores (directamente, sin referencias). Esto destruye vector1. Así que después de construir el nuevo vector1_b, no se puede volver a usar vector1. Por último, se usa .iter_mut() sobre el vector2. Es mutable, por lo que no se necesita utilizar .collect() para crear un nuevo Vec. En vez de ello, se modifican difectamente los valores del Vec con referencias modificables. Por eso, vector2 sigue existiendo con los valores modificados. Por ello, se utiliza for_each en lugar de map().

