Los cierres o closures (en inglés) son una especie de funciones rápidas que no necesitan un nombre. En ocasiones se les denomina funciones lambdas. Son fáciles de encontrar en el código debido a que utilizan || en lugar de (). Son muy habituales en Rust y una vez se aprenden a utilizar uno se pregunta como ha podido vivir sin ellos. Se puede asociar un closure a una variable y en ese caso funciona y parece exactamente como una función: fn main() { let my_closure = || println!("Esto es un cierre"); my_closure();
} Este closure no recibe nada coomo parámetro || e imprime el mensaje Esto es un cierre. Entre los símbolos || se pueden añadir variables de entrada y tipos, como se hace en las funciones dentro de (): fn main() { let my_closure = |x: i32| println!("{}", x); my_closure(5); my_closure(5+5);
} Imprime: 5
10 Cuando un cierre se hace más complejo, se puede escribir con un bloque de código que puede ser tan largo como se requiera: fn main() { let my_closure = || { let number = 7; let other_number = 10; println!("Los dos números son {} y {}.", number, other_number); // Este cierre puede ser tan largo como se necesite, como sucede con las funciones. }; my_closure();
} Pero los cierres son especiales porque pueden guardarse valores de variables que se encuentren fuera del ellos incluso aunque no reciban parámetros (es decir, incluso habiendo escrito ||). Por ello, se puede escribir: fn main() { let number_one = 6; let number_two = 10; let my_closure = || println!("{}", number_one + number_two); my_closure();
} Este código imprime 16. No ha sido necesario añadir parámetros a || porque se pueden usar las variables dentro del código del cierre y sumarlas ahí. Por cierto, por eso se llaman closures . Porque pueden tomar unas variables y encerrarlas dentro. Esto significa que si se quiere hablar con precisión: Una || que no encierra ninguna variable exterior en su interior es una función anónima . No es, estrictamente, un closure . Una || que sí encierra una variable exterior en su interior sí es un cierre . Sin embargo, esta precisión no se suele hacer en el habla coloquial. Así que en este texto simplemente se llaman cierres a todos los ||. ¿Por qué es bueno conocer la diferencia? Porque las funciones anónimas generan realmente el mismo código que el de las funciones con nombre. Aunque pueda parecer que el código máquina de una función anónima será más complejo, no lo es. Es igual (y, por lo tanto, igual de rápido) que el código de una función habitual. Para qué pueden servir los cierres. Por ejemplo: fn main() { let number_one = 6; let number_two = 10; let my_closure = |x: i32| println!("{}", number_one + number_two + x); my_closure(5);
} Este cierre guarda en su interior a dos variables number_one y number_two. Pero también recibe como parámetro una nueva variable x y cuando se ejecuta, se le pasa 5 al parámetro x. Suma los tres valores y, en este caso, devuelve 21. Normalmente, se usan los cierres para pasarlos como parámetros a determinados métodos. En la última sección se usaron cierres con .map()y .for_each(). En esa sección, se escribió |x| para obtener el siguiente elemento en un iterador; eso era un cierre. Otro ejemplo: el método unwrap_or que se usa para asignar un valor cuando no funciona unwrap. Igual que se puede escribir la siguiente función let fourth = my_vec.get(3).unwrap_or(&0);, existe también el método unwrap_or_else que recibe un cierre como parámetro. Por ejemplo: fn main() { let my_vec = vec![8, 9, 10]; let fourth = my_vec.get(3).unwrap_or_else(|| { // Intenta "desenvolver". Si no funciona: if my_vec.get(0).is_some() { // observa si el vector contiene algo en el índice [0] &my_vec[0] // Utiliza ese valor si existe algo. } else { &0 // en otro caso, usa el &0 } }); println!("{}", fourth);
} Por supuesto, los cierres pueden ser muy simples. Se puede escribir, simplemente let fourth = my_vec.get(3).unwrap_or_else(|| &0);. No siempre se necesita usar {} y escribir código complejo solo porque es un cierre. Solo con escribir || el compilador conoce que hay un cierre. Quizás el uso más habitual de un cierre sea en la función .map(). A continuación se muestra otro ejemplo: fn main() { let num_vec = vec![2, 4, 6]; let double_vec = num_vec // usa el vector .iter() // para recorrerlo (iterar) .map(|number| number * 2) // para cada elemento, lo multiplica por 2 .collect::<Vec<i32>>(); // y crea un nuevo vector a partir de ello println!("{:?}", double_vec);
} Otro buen ejemplo es su uso con .for_each() después de .enumerate(). El método .enumerate() devuelve un iterador con el número de índice del elemento y el propio elemento. Por ejemplo, de [10, 9, 8 ] se obtiene (0, 10), (1, 9), (2, 8). Con los tipos (usize, i32). fn main() { let num_vec = vec![10, 9, 8]; num_vec .iter() // itera sobre num_vec .enumerate() // obtiene pares de (índice, valor) .for_each(|(index, number)| println!("El índice {} contiene el valor {}", index, number)); // imprime para cada elemento
} Este código imprime: El índice 0 contiene el valor 10
El índice 1 contiene el valor 9
El índice 2 contiene el valor 8 En este caso se usa for_each en lugar de map. map es para ejecutar algo en cada elemento y pasarlo al siguiente paso (es un iterador en sí mismo) y actua de forma perezosa , es decir, si no hay nadie a quien pasarle el valor, no hace nada. for_each realiza la operación cuando recibe cada elemento. Por eso en caso de map hace falta usar un método como collect para obtener un resultado. Esta es una característica muy interesante de los iteradores. Si se intenta ejecutar un map sin utilizar un método como collect, el compilador observará que ese código no hace nada. No fallará, pero lo indicará: fn main() { let num_vec = vec![10, 9, 8]; num_vec .iter() .enumerate() .map(|(index, number)| println!("El índice {} contiene el valor {}", index, number)); } Mostrará: warning: unused `std::iter::Map` that must be used --> src\main.rs:4:5 |
4 | / num_vec
5 | | .iter()
6 | | .enumerate()
7 | | .map(|(index, number)| println!("Index number {} has number {}", index, number)); | |_________________________________________________________________________________________^ | = note: `#[warn(unused_must_use)]` on by default = note: iterators are lazy and do nothing unless consumed Se trata de un aviso warning , no es un error. El programa funciona correctamente. Pero no suma nada. Si se observa el tipo del resultado de cada fila, se entenderá: let num_vec = vec![10, 9, 8]; En este momento se tiene un Vec<i32>. .iter() El valor de retorno de esta función es un Iter<i32>. Es decir, un iterador sobre elementos de tipo i32. .enumerate() Ahora es de tipo enumerado Enumerate<Iter<i32>>. Es decir, un Enumerate sobre un Iter de i32s. .map() Y ahora el tipo es Map<Enumerate<Iter<i32>>>. Es decir, un Map sobre un Enumerate sobre un Iter de i32s. Hasta el momento, todo lo que han hecho las funciones es ir construyendo una estructura compleja que está lista para usarse, solo que hay que decirle de algún modo que lo haga. Rust hace todo esto porque necesita ejecutarse rápido. No quiere hacer: itera sobre todos los i32 en el vector luego enumera todos los i32 del iterador luego ejecuta la función sobre todos los i32 Rust realiza un único "bucle" solo cuando lo necesita. En el momento que se ejecuta una función como .collect::<Vec<i32>>() Rust sabe que se le está pidiendo construir un vector y comienza a pedir los diferentes valores. Esto es lo que significa que los iteradores son perezosos y no hacen nada a no ser que se consuman . Se pueden crear cosas muy complejas como HashMap mediante el uso de .collect(). A continuación se muestra un ejemplo sobre como construir un HashMap a partir de dos vectores. En primer lugar, se construyen ambos vectores. Después se usará into_iter() para obtener un interador sobre los valores. Posteriormente se usará .zip() para unir ambos iteradores como un una cremallera, emparejando cada elemento de un iterador con el obtenido del otro. Por último, se utilizará .collect() para crear el HashMap: use std::collections::HashMap; fn main() { let some_numbers = vec![0, 1, 2, 3, 4, 5]; // un Vec<i32> let some_words = vec!["cero", "uno", "dos", "tres", "cuatro", "cinco"]; // un Vec<&str> let number_word_hashmap = some_numbers .into_iter() // obtiene un iter .zip(some_words.into_iter()) // se combinan con .zip() dos iter. .collect::<HashMap<_, _>>(); println!("Para la clave {} se obtiene {}.", 2, number_word_hashmap.get(&2).unwrap());
} Que imprime: Para la clave 2 se obtiene dos. Se observa que se escribió <HashMap<_, _>>, que es información suficiente para que Rust sepa decidir el tipo del objeto como <HashMap<i32, &str>>. También habría sido posible haber escrito .collect::<HashMap<i32, &str>>();. E incluso así: use std::collections::HashMap; fn main() { let some_numbers = vec![0, 1, 2, 3, 4, 5]; // un Vec<i32> let some_words = vec!["cero", "uno", "dos", "tres", "cuatro", "cinco"]; // un Vec<&str> let number_word_hashmap: HashMap<_, _> = some_numbers // Puesto que se indica el tipo aquí... .into_iter() .zip(some_words.into_iter()) .collect(); // no es necesario indicarlo aquí
} Hay otro método que es como .enumerate(), pero para el tipo char: .char_indices(). Se usa de la misma forma. Si se supone que se tiene una cadena que está formada por números de tres dígitos: fn main() { let numbers_together = "140399923481800622623218009598281"; for (index, number) in numbers_together.char_indices() { match (index % 3, number) { (0..=1, number) => print!("{}", number), // solo imprime el número si hay resto _ => print!("{}\t", number), // en otro caso, imprime el número y un tabulador } }
} Esto imprime: 140 399 923 481 800 622 623 218 009 598 281.

