En ocasiones se puede ver |_| en un cierre. Esto significa que el cierre (closure) necesita un argumento (como podría ser una variable x), pero no se va a usar. Así que esta expresión en los parámetros de un cierre significa: vale, el cierre recibe un parámetro, pero no le doy un nombre porque no lo uso". A continuación, se muestra un ejemplo que da error por no expresar el parámetro: fn main() { let my_vec = vec![8, 9, 10]; println!("{:?}", my_vec.iter().for_each(|| println!("No usamos la variable que se necesita"))); // ⚠️
} Rust da un error que dice: error[E0593]: closure ¿Está expected to take 1 argument, but it takes 0 arguments --> src/main.rs:4:36 |
4 | println!("{:?}", my_vec.iter().for_each(|| println!("No usamos la variable que se necesita"))); // ⚠️ | ^^^^^^^^ -- takes 0 arguments | | | expected closure that takes 1 argument El propio compilador da alguna pista: help: consider changing the closure to take and ignore the expected argument |
4 | println!("{:?}", my_vec.iter().for_each(|_| println!("No usamos la variable que se necesita"))); // ⚠️ | ~~~ Es decir, que se debe pasar el argumento que necesita cualquier cierre que se pase como parámetro a la función for_each. Si se cambia de este modo, funcionará: fn main() { let my_vec = vec![8, 9, 10]; println!("{:?}", my_vec.iter().for_each(|_| println!("No usamos la variable que se necesita")));
}

