Rust es un lenguaje muy divertido cuando se dominan los cierres. Con ellos se pueden encadenar métodos para hacer mucho con poco código. A continuación, se muestrans algunos métodos que se utilizan con cierres que aún no se habían visto: .filter(): a partir de un iterador, permite conservar los elementos que se deseen. El siguiente ejemplo filtra los meses del año: fn main() { let meses = vec!["Enero", "Febrero", "Marzo", "Abril", "Mayo", "Junio", "Julio", "Agosto", "Septiembre", "Octubre", "Noviembre", "Diciembre"]; let filtered_meses = meses .into_iter() // crea un iterador .filter(|month| month.len() <= 5) // Solo los meses con cinco o menos caracters (byte) // En este caso, todos los caracteres son de un byte, por eso funciona usar .len() .filter(|month| month.contains("u")) // Se seleccionan solo los meses que contengan la letra u .collect::<Vec<&str>>(); println!("{:?}", filtered_meses);
} Esto imprime: ["Junio", "Julio"]. .filter_map(): este método realiza de una vez la función de .filter() y .map(). El cierre que se pasa como parámetro,debe devolver un Option<T>. El método filter_map() extraerá T para aquellos elementos que tengan valor (que sean de tipo Some<T>) y desechará los que sean de tipo None. Por ejemplo, el uso de .filter_map() con un vector como vec![Some(2), None, Some(3)] devuelve [2, 3]. A continuación se muestra un ejemplo con un struct de una Empresa. Cada empresa tiene un campo nombre de tipo String, y un campo ceo para describir a su responsable. El ceo puede haber dimitido, por lo que es de tipo Option<String> En el ejemplo, se filtran las empresas para mostrar el valor de los CEO. struct Empresa { nombre: String, ceo: Option<String>,
} impl Empresa { fn new(nombre: &str, ceo: &str) -> Self { let ceo = match ceo { "" => None, ceo => Some(ceo.to_string()), }; // Se crea el valor del campo ceo y debajo se crea el elemento struct Self { nombre: nombre.to_string(), ceo, } } fn get_ceo(&self) -> Option<String> { self.ceo.clone() // Devuelve un clone del CEO (struct no es tipo Copy) }
} fn main() { let empresa_vec = vec![ Empresa::new("Umbrella Corporation", "Unknown"), Empresa::new("Ovintiv", "Doug Suttles"), Empresa::new("The Red-Headed League", ""), Empresa::new("Stark Enterprises", ""), ]; let all_the_ceos = empresa_vec .into_iter() .filter_map(|empresa| empresa.get_ceo()) // filter_map recibe Option<T> que es lo que necesita .collect::<Vec<String>>(); println!("{:?}", all_the_ceos);
