La mutabilidad interior permite modificar el interior de un elemento sin necesidad de que la variable sea mut. Rust permite hacer esto en algunos casos de forma segura, modificando los valores internos de un struct que es inmutable. Cada uno de los mecanismos que se tienen a disposición, sigue unas reglas que aseguran que la modificación es segura. En primer lugar, se presenta el siguiente ejemplo: struct PhoneModel { company_name: String, model_name: String, screen_size: f32, memory: usize, date_issued: u32, on_sale: bool,
} fn main() { let super_phone_3000 = PhoneModel { company_name: "YY Electronics".to_string(), model_name: "Super Phone 3000".to_string(), screen_size: 7.5, memory: 4_000_000, date_issued: 2020, on_sale: true, }; } En este ejemplo, es mejor que los campos de PhoneModel sean inmutables. Por ejemplo, date_issued y screen_size nunca cambian. Pero en su interior, también existe un campo denominado on_sale. Un modelo de teléfono empieza su vida estando a la venta (true en este campo), pero más tarde se deja de vender. ¿Se puede hacer que solo este campo sea modificable sin que se tenga que hacer todo el struct modificable? Es decir, sin tener que hacer let mut super_phone_3000 = ..., ya que de hacerlo así, todos los campos serían modificables. Rust tiene varias formas de permitir la modificación segura dentro de un lugar que es inmutable en general. La forma más simple es el uso de Cell. Se tiene que incluir use std::cell::Cell para poder usarlo y a partir de ahí usar normalmente Cell. use std::cell::Cell; struct PhoneModel { company_name: String, model_name: String, screen_size: f32, memory: usize, date_issued: u32, on_sale: Cell<bool>,
} fn main() { let super_phone_3000 = PhoneModel { company_name: "YY Electronics".to_string(), model_name: "Super Phone 3000".to_string(), screen_size: 7.5, memory: 4_000_000, date_issued: 2020, on_sale: Cell::new(true), }; // 10 years later, super_phone_3000 is not on sale anymore super_phone_3000.on_sale.set(false);
} Cellfunciona para todos los tipos, pero funciona mejor para los tipos simples Copy porque Cell no usa referencias. Tiene un método denominado get() que solo funciona en tipos Copy. Otro tipo que se puede usar es RefCell.

