Un RefCell es otra forma de cambiar valores sin necesidad de declararlos mut. Es como Cell, pero utiliza referencias en lugar de copias. El ejemplo a continuación permite ver cómo es similar a Cell. use std::cell::RefCell; #[derive(Debug)]
struct User { id: u32, year_registered: u32, username: String, active: RefCell<bool>, // Many other fields
} fn main() { let user_1 = User { id: 1, year_registered: 2020, username: "User 1".to_string(), active: RefCell::new(true), }; println!("{:?}", user_1.active);
} Este ejemplo imprime RefCell { value: true }. RefCell tiene muchos métodos. Dos de ellos son .borrow() y .borrow_mut(). Con estos métodos, se puede hacer lo mismo que con & y &mut. Las reglas son las mismas: Se pueden hacer muchos préstamos simultáneos. Solo se puede hacer un préstamo modificable. No se pueden hacer préstamos simultáneos de ambos tipos. Modificar el valor de un RefCell es así de fácil: // 🚧
user_1.active.replace(false);
println!("{:?}", user_1.active); Dispone también de otros métodos como replace_with que utiliza un cierre (closure): // 🚧
let date = 2020; user_1 .active .replace_with(|_| if date < 2000 { true } else { false });
println!("{:?}", user_1.active);
} Es necesario prestar atención al uso de RefCell ya que valida si los préstamos son correctos en tiempo de ejecución. No en tiempo de compilación. Es decir, cuando el programa ya se está ejecutando. Por eso, cosas como esta compilarán, aunque sean erróneas: use std::cell::RefCell; #[derive(Debug)]
