} fn main() { let user_1 = User { id: 1, year_registered: 2020, username: "User 1".to_string(), active: RefCell::new(true), }; let borrow_one = user_1.active.borrow_mut(); // primer préstamo modificable - correcto let borrow_two = user_1.active.borrow_mut(); // segundo préstamo modificable (sigue el primero) - incorrectos
} Si se ejecuta el código anterior, Rust entrará en pánico : thread 'main' panicked at 'already borrowed: BorrowMutError', src/main.rs:21:36
note: run with `RUST_BACKTRACE=1` environment variable to display a backtrace
error: process didn't exit successfully: `target\debug\rust_book.exe` (exit code: 101) Lo destacable del mensaje de error es already borrowed: BorrowMutError. Así que cuando se usan RefCell resulta conveniente ejecutar el código y pasar un conjunto de pruebas.

