Los Mutex posibilitan otra forma de modificar valores sin declararlos como mut. Significa exclusión mutua , lo que significa que "solo puede modificarlo un proceso cada vez". Por eso, el uso de mutex es seguro, porque permite la modificación interna, pero solo a un proceso cada vez. Es útil en la programación concurrente. Para ello, este tipo utiliza .lock(). Esta función es como cerrar la puerta con un candado desde dentro: se entra en una habitación, se cierra con llave y a partir de ahí, se puede modificar lo que contenga la habitación. Ningún otro proceso puede entrar a detener o contradecir los cambios. Los mutex son más fáciles de explicar a través de ejemplos: use std::sync::Mutex; fn main() { let my_mutex = Mutex::new(5); // Un nuevo Mutex<i32>. No se dice que sea mut let mut mutex_changer = my_mutex.lock().unwrap(); // mutex_changer es un MutexGuard // Esta veriable tiene que ser mut para cambiarla // Con ella se tiene acceso al contenido de Mutex // Si se intenta imprimir el mutex: println!("{:?}", my_mutex); // Se imprime "Mutex { data: <locked> }" // El mensaje indica que no es posible acceder al valor, // está bloquedo y solo puede acceder mutex_changer // mientras mantenga el bloqueo println!("{:?}", mutex_changer); // Esto sí funciona, imprime 5. Se cambiara a 6. *mutex_changer = 6; // mutex_changer es un MutexGuard<&i32> se usa * para cambiar el valor i32 println!("{:?}", mutex_changer); // Ahora indica 6
} ¿Cómo se puede "reabrir la puerta"? ¿Cómo se puede liberar el bloqueo del valor que aún mantiene mutex_changer para que otro lo pueda usar? Es necesario que la variable MutexGuard salga fuera de ámbito. Que su código finalice. Por ejemplo: use std::sync::Mutex; fn main() { let my_mutex = Mutex::new(5); { let mut mutex_changer = my_mutex.lock().unwrap(); *mutex_changer = 6; } // mutex_changer sale de ámbito - desaparece. Ya no está bloquedo el valor. println!("{:?}", my_mutex); // Ahora indica: Mutex { data: 6 }
} Es necesario tener cuidado en la programación concurrente ya que se pueden producir interbloqueos debido a que un segundo intento de bloqueo sobre un mutex mientras está bloquedo por otra variable producirá la parada y espera del segundo intento. Sin programación concurrente, se puede ver en el siguiente ejemplo: use std::sync::Mutex; fn main() { let my_mutex = Mutex::new(5); let mut mutex_changer = my_mutex.lock().unwrap(); // mutex_changer tiene el bloqueo let mut other_mutex_changer = my_mutex.lock().unwrap(); // other_mutex_changer quiere bloquear // el programa se queda parado esperando // y esperando // y esperará para siempre. println!("Esto nunca se imprimirá...");
} Existe otro método try_lock() que intenta obtener el bloqueo una vez y si no lo consigue abando. En este caso, no se debe usar try_lock().unwrap() ya que si no consigue el bloqueo, la aplicación entrará en pánico . En este caso no se puede renunciar a let o match para validar correctamente: use std::sync::Mutex; fn main() { let my_mutex = Mutex::new(5); let mut mutex_changer = my_mutex.lock().unwrap(); let mut other_mutex_changer = my_mutex.try_lock(); // intenta obtener el bloqueo if let Ok(value) = other_mutex_changer { println!("El MutexGuard contiene: {}", value) } else { println!("No se pudo obtener el bloqueo") }
} Tampoco es necesario crear una variable para modificar el valor: use std::sync::Mutex; fn main() { let my_mutex = Mutex::new(5); *my_mutex.lock().unwrap() = 6; println!("{:?}", my_mutex);
} La línea de código *my_mutex.lock().unwrap() = 6; significa que *bloquea para mi uso el valor contenido en el mutex y conviértela en el 6". De esta forma, no existe variable y, por lo tanto, no es necesario desbloquear el mutex saliendo del ámbito de una variable. Esto se puede hacer tantas veces como se quiera: use std::sync::Mutex; fn main() { let my_mutex = Mutex::new(5); for _ in 0..100 { *my_mutex.lock().unwrap() += 1; // bloquea y desbloquea 100 veces } println!("{:?}", my_mutex);
}

