RwLock significa "bloqueo de lectura y escritura". Es como un Mutex, pero también como un RefCell. Se utiliza .write().unwrap() para modificarlo, en lugar de .lock().unwrap(). Y también se puede usar .read().unwrap() para obtener acceso de lectura. Es como RefCellya que sigue las reglas: se pueden tener muchas varaibles .read(). se puede tener una sola variable .write(). no se puede tener a la vez una variable .write() con otras variables. El programa se quedará bloqueado para siempre si se intenta .write() cuando no se puede obtener acceso. use std::sync::RwLock; fn main() { let my_rwlock = RwLock::new(5); let read1 = my_rwlock.read().unwrap(); // un .read() es correcto let read2 = my_rwlock.read().unwrap(); // dos.read() también es correcto println!("{:?}, {:?}", read1, read2); let write1 = my_rwlock.write().unwrap(); // uh oh, aquí el programa se ejecutará para siempre
} Se debe liberar el bloqueo previo. Para ello se usa std::mem::drop. Igual que se podía hacer con mutex. use std::sync::RwLock;
use std::mem::drop; // We will use drop() many times fn main() { let my_rwlock = RwLock::new(5); let read1 = my_rwlock.read().unwrap(); let read2 = my_rwlock.read().unwrap(); println!("{:?}, {:?}", read1, read2); drop(read1); drop(read2); // descartamos las dos variables, para oder usar .write() let mut write1 = my_rwlock.write().unwrap(); *write1 = 6; drop(write1); println!("{:?}", my_rwlock);
} También se puede usar try_read() y try_write(). use std::sync::RwLock; fn main() { let my_rwlock = RwLock::new(5); let read1 = my_rwlock.read().unwrap(); let read2 = my_rwlock.read().unwrap(); if let Ok(mut number) = my_rwlock.try_write() { *number += 10; println!("Ahora el núemro es {}", number); } else { println!("No se puede obtener acceso, lo siento.") };
}

