Un alias para un tipo permite darle un nuevo nombre. Normalmente, se usan cuando se tiene un nombre de tipo muy largo que no se quiere escribir cada vez. También sirve para cuando se quiere dar un nombre más apropiado o fácil de recordar en el contexto de la aplicación. A continuación se muestran dos ejemplos de alias. El siguiente ejemplo sirve para darle un nombre más fácil de comprender en el código: type CharacterVec = Vec<char>; fn main() {} EL siguiente ejemplo sirve para mostrar un caso con un tipo difícil de entender: // this return type is extremely long
fn returns<'a>(input: &'a Vec<char>) -> std::iter::Take<std::iter::Skip<std::slice::Iter<'a, char>>> { input.iter().skip(4).take(5)
} fn main() {} Con un alias queda mucho más claro: type SkipFourTakeFive<'a> = std::iter::Take<std::iter::Skip<std::slice::Iter<'a, char>>>; fn returns<'a>(input: &'a Vec<char>) -> SkipFourTakeFive { input.iter().skip(4).take(5)
} fn main() {} Lógicamente, también se puede importar un tipo para hacer las definiones más simples. El ejemplo anterior quedaría así: use std::iter::{Take, Skip};
use std::slice::Iter; fn returns<'a>(input: &'a Vec<char>) -> Take<Skip<Iter<'a, char>>> { input.iter().skip(4).take(5)
} fn main() {} Así que se puede decidir qué es mejor en cada caso. Los alias no crean un tipo nuevo. Solo se trata de un nuevo nombre que representa al tipo ya existente. Por ello, si se escribe el siguiente código type File = String;, el compilador solo ve el tipo String. Por ello, imprimirá true: type File = String; fn main() { let my_file = File::from("I am file contents"); let my_string = String::from("I am file contents"); println!("{}", my_file == my_string);
} ¿Cómo se haría si realmente se quisiera un tipo nuevo? Lo más simple es usar el tipo de struct que representa tuplas incluyendo el tipo preexistente (Se trata de un uso idiomático de Rust que se denomina newtype). struct File(String); // File es un envoltorio de String fn main() { let my_file = File(String::from("I am file contents")); let my_string = String::from("I am file contents");
} Ahora, el siguiente código ya no funciona debido a que son dos tipos diferentes: struct File(String); // File es un envoltorio de String fn main() { let my_file = File(String::from("I am file contents")); let my_string = String::from("I am file contents"); println!("{}", my_file == my_string); // ⚠️ no se puede comparar File con String
} Para poder compararlos, hay que recuperar la cadena de texto incluida en File con my_file.0: struct File(String); fn main() { let my_file = File(String::from("I am file contents")); let my_string = String::from("I am file contents"); println!("{}", my_file.0 == my_string); // my_file.0 es String, así que imprime true
} El nuevo tipo creado, no tienen ningún rasgo, pero se pueden implementar como siempre. # #![allow(unused)]
# fn main() {
#[derive(Clone, Debug)]
struct File(String);
# } En el código anterior, el tipo File se puede clonar y depurar (imprimir sus valores), pero no dispone de los demás rasgos de String. Quien sí sigue teniendo dichos rasgos es la cadena interior .0. Si este código se usara como librería en otros programas, esta cadena interior no estaría accesible, salvo en el caso de que se marcara como pub. Por eso, en esta clase de tipos es habitual el uso del rasgo Deref. Ambos conceptos, pub y Deref, se verán más adelante.

