Normalmente, se escribe use al inicio del programa, de esta forma: use std::cell::{Cell, RefCell}; fn main() {} Pero es posible, como se ha visto, usarlo en cualquier parte del código. Especialmente en funciones con enumerados que tienen nombres largos. Por ejemplo: enum MapDirection { North, NorthEast, East, SouthEast, South, SouthWest, West, NorthWest,
} fn main() {} fn give_direction(direction: &MapDirection) { match direction { MapDirection::North => println!("You are heading north."), MapDirection::NorthEast => println!("You are heading northeast."), // Hay que teclear mucho... Y seguir tecleando el resto de opciones }
} Sin embargo, es posible simplificar escribiendo un use dentro de la propia función. enum MapDirection { North, NorthEast, East, SouthEast, South, SouthWest, West, NorthWest,
} fn main() {} fn give_direction(direction: &MapDirection) { use MapDirection::*; // Se importa todo en MapDirection let m = "You are heading"; match direction { North => println!("{} north.", m), NorthEast => println!("{} northeast.", m), // Es un poco menos a escribir // ⚠️ }
} Se ha visto ya que ::* significa que "se importa todo lo que venga después de ::". En este caso, significa que se importa North, NorthEast, ... y así hasta NorthWest. También se puede hacer la importar código de terceros. Esto puede dar lugar a problemas cuando parte de nuestro código tiene nomenclatura idéntica a la de otras librerías. Por eso, no es recomendable usar ::* a menos que se esté seguro de ello. Algunas veces se observará que existe una sección denominada prelude en el código de otras librerías. Por convenio, esta es la forma de agrupar los elementos que se necesitarán de forma habitual. En este caso, la forma de importarlo recomendada, sí suele ser con *, así: name::prelude::*. Se hablará más de ello en las secciones dedicadas a modules y crates. También se puede usar as para cambiar los nombres. Por ejemplo, se puede dar el caso de estar utilizando el código de otro desarrollador y no se pueden cambiar los nombres en un enum: enum FileState { CannotAccessFile, FileOpenedAndReady, NoSuchFileExists, SimilarFileNameInNextDirectory,
} fn main() {} Así que se puede importar todo y luego cambiarle los nombres. enum FileState { CannotAccessFile, FileOpenedAndReady, NoSuchFileExists, SimilarFileNameInNextDirectory,
} fn give_filestate(input: &FileState) { use FileState::{ CannotAccessFile as NoAccess, FileOpenedAndReady as Good, NoSuchFileExists as NoFile, SimilarFileNameInNextDirectory as OtherDirectory }; match input { NoAccess => println!("Can't access file."), Good => println!("Here is your file"), NoFile => println!("Sorry, there is no file by that name."), OtherDirectory => println!("Please check the other directory."), }
} fn main() {} Por lo que ahora se puede escribir OtherDirectory en lugar de FileState::SimilarFileNameInNextDirectory.

